import PropTypes from "prop-types"

function Header(props) {
  const headerStyles = { backgroundColor: "blue", color: "red" }
  return (
    <header style={headerStyles}>
      <div className='container'>
        <h2>{props.text}</h2>
      </div>
    </header>
  )
}

Header.propTypes = {
  text: PropTypes.string,
}

export default Header
